Vă vom arăta {imageCount, plural, 
  one {o imagine} 
  other {două imagini}
}, alegeți-o pe cea care arată cel mai bine. Vă rugăm să vă bazați alegerile pe aspectul imaginii și preferințele personale. Nu vă faceți griji de solicitări.<br></br><br></br> Puteți selecta imaginile direct sau puteți folosi tastele A/B sau 1/2 de pe tastatură. Dacă nu sunteți sigur, selectați Omite (tasta S sau 3).<br></br><br></br> Orice imagini pe care le selectați, omiteți sau raportați vor fi înregistrate de echipa Firefly pentru a ajuta la antrenarea și îmbunătățirea caracteristicilor noastre de generare a imaginilor.
